  return (
    <div >
      <img id='poster' src={`https://image.tmdb.org/t/p/w500${image}`} height='500px' width='350px' alt="Italian Trulli"/>
     <div className='movieInfo'>
     <div>{title}</div>
        <div>{year}</div>
      </div> 
    </div> 
  );
}

export default Movie;
